import React, { Component } from 'react';
import { Switch, Redirect, Router } from 'react-router-dom';

import Menu from './Components/Menu/Menu';
import 'antd/dist/antd.css';
import './App.css';

function App() {
  return (
    <Router>
        <Switch>
          <Menu />
        </Switch>
      </Router>
  );
}

export default App;
